import React from "react";
import { IconButton, Paper, styled } from "@mui/material";
import AddIcon from '@mui/icons-material/Add';

const UploadPhotoCard = () => {
      const PaperButton = styled(Button) ({
            "&:hover": {
                  backgroundColor: 'red'
            }
      })

      return(
                  <PaperButton>
                  <Paper 
                        elevation={2}
                        sx={{
                              display: 'flex',
                              flexWrap: 'wrap',
                              width: 220,
                              height: 220,
                              justifyContent: 'center',
                              alignItems: 'center',
                              borderRadius: '10px',
                              border: '2px color #666'
                        }}
                  >
                        <AddIcon sx={{fontSize: '8em', color: '#F374E7'}}/>
                  </Paper>
                  </PaperButton>
      );
}

export default UploadPhotoCard;
